import ButtonAppBar from "./ButtonAppBar";
import Box from '@mui/material/Box';
import { Typography, Avatar } from "@mui/material";

import sweaterrecycle from '../assets/sweaterrecycle.png'
import nackalogo from '../assets/nackalogo.webp'

const Notification = () => {


    return (
        <>
            <ButtonAppBar />
            <Box
                sx={{
                    width: 300,
                    height: 150,
                    backgroundColor: 'rgba(255, 255, 255, 0.8)',
                    boxShadow: 'rgba(0, 0, 0, 0.24) 0px 3px 8px;',
                    borderRadius: '20px',
                    margin: 'auto',
                    marginTop: '50px'
                }}>
                <Typography variant="h5" sx={{ textAlign: 'center' }}>
                    Ditt paket har registrerats
                </Typography>
                <Typography sx={{ textAlign: 'center', marginTop: '10px' }}>
                    Tack för att du är med och bidrar till en bättre miljö i våran kommun.
                </Typography>
            </Box>
            <Avatar
                variant='rounded'
                alt='Sweater recycle'
                src={sweaterrecycle}
                sx={{
                    width: '150px', height: '156px', margin: 'auto', marginTop: '15px', opacity: '0.8'
                }}
            />
            <Avatar
                variant="square"
                alt='Nacka logo'
                src={nackalogo}
                sx={{
                    width: '300px', height: '300px', margin: 'auto', marginTop: '15px',
                }}
            />
            <img src={nackalogo}></img>
        </>
    );
}

export default Notification;
